sources.partials/galleries.scss:
.gallery {
  .lb-album {
    list-style: none;
    padding-bottom: 2rem;
    padding: 0 !important;
    display: inline-block;

    li {
      float: left;
      margin: 10px 10px 0 0;
    }

    li > a,
    li > a img {
      display: block;
    }

    li > a {
      width: 200px;
      height: 150px;
    }
  }

  .lb-overlay {
    background: hsl(var(--grey-drk) / 1);
    display: none !important;
    height: 0px;
    overflow: hidden;
    padding: 0 0 0 0;
    position: fixed;
    left: 0px;
    top: 0;
    text-align: center;
    width: 0px;
    z-index: 999999;

    .controls {
      margin: 0 0 0 -250px;
      opacity: 0;
      position: absolute;
      left: 50%;
      top: 25px;
      //transition: opacity .3s linear .2s;
      width: 500px;
      z-index: 1001;

      .svg-inline--fa {
        color: hsl(var(--light) / 1);
        height: 50px;
        width: 50px;
      }
    }

    img {
      box-shadow: 0px 2px 7px rgba(255, 255, 255, 0.2);
      height: auto;
      max-height: 70vh;
      position: relative;
      top: 0;
      width: auto;
      max-width: 90vw;
    }

    .info {
      color: hsl(var(--light) / 1);
      margin: 10px auto 0 auto;
      max-width: 1000px;
      opacity: 0;
      position: relative;
      top: 0;
      text-shadow: 0px 1px 1px rgba(255, 255, 255, 0.6);
      transition: opacity 1s linear 1.2s;

      h3 {
        display: inline-block;
        border-right: 1px solid hsl(var(--light) / 1);
        padding: 0.75rem 1rem 0.75rem 0 !important;
      }

      p {
        display: inline-block;
        padding: 0 0 0 1rem;
      }
    }
  }

  .lb-overlay:target {
    display: block !important;
    width: auto;
    height: auto;
    bottom: 0px;
    right: 0px;
    padding: 80px 0.25rem 120px 0.25rem;
  }
  .lb-overlay:target img {
    animation: fadeInScale 1.2s ease-in-out;
  }
  .lb-overlay:target .controls,
  .lb-overlay:target .info {
    opacity: 1;
  }

  @-webkit-keyframes fadeInScale {
    0% {
      -webkit-transform: scale(0.6);
      opacity: 0;
    }
    100% {
      -webkit-transform: scale(1);
      opacity: 1;
    }
  }
  @-moz-keyframes fadeInScale {
    0% {
      -moz-transform: scale(0.6);
      opacity: 0;
    }
    100% {
      -moz-transform: scale(1);
      opacity: 1;
    }
  }
  @-o-keyframes fadeInScale {
    0% {
      -o-transform: scale(0.6);
      opacity: 0;
    }
    100% {
      -o-transform: scale(1);
      opacity: 1;
    }
  }
  @-ms-keyframes fadeInScale {
    0% {
      -ms-transform: scale(0.6);
      opacity: 0;
    }
    100% {
      -ms-transform: scale(1);
      opacity: 1;
    }
  }
  @keyframes fadeInScale {
    0% {
      transform: scale(0.6);
      opacity: 0;
    }
    100% {
      transform: scale(1);
      opacity: 1;
    }
  }
  /*
  	100% Height for Opera as the max-height seems to be ignored, not optimal for large screens
  	http://bricss.net/post/11230266445/css-hack-to-target-opera
  */
  x:-o-prefocus,
  .lb-overlay img {
    height: 100%;
  }
}

sources.partials/header.scss:
header {
  nav {
    display: flex;
    justify-content: space-between;
    height: auto;
    width: 100%;

    /* Logo /////////////////////////////////////*/
    #logo {
      width: 90%;

      svg {
        display: block;
        margin-right: var(--padd-md);
      }
    }

    /* Switch ////////////////////////////////*/
    input#menu-toggle {
      display: none;
    }

    label.menu-button-container {
      display: flex;
      height: 100%;
      position: relative;
      top: 2rem;
      right: 2rem;
      width: 30px;
      cursor: pointer;
      flex-direction: column;
      justify-content: center;
      align-items: center;

      .menu-button,
      .menu-button::before,
      .menu-button::after {
        display: block;
        background-color: hsl(var(--dark));
        position: absolute;
        height: 4px;
        width: 30px;
        transition: transform 400ms cubic-bezier(0.23, 1, 0.32, 1);
        border-radius: 2px;
        z-index: 1200;
      }

      .menu-button::before {
        content: "";
        margin-top: -8px;
      }

      .menu-button::after {
        content: "";
        margin-top: 8px;
      }
    }
    #menu-toggle:checked + .menu-button-container .menu-button {
      position: fixed;
    }

    #menu-toggle:checked + .menu-button-container .menu-button::before {
      background-color: hsl(var(--light) / 1);
      margin-top: 0px;
      transform: rotate(405deg);
    }

    #menu-toggle:checked + .menu-button-container .menu-button {
      background-color: transparent;
    }

    #menu-toggle:checked + .menu-button-container .menu-button::after {
      background-color: hsl(var(--light) / 1);
      margin-top: 0px;
      transform: rotate(-405deg);
    }

    /* Navigation //////////////////////////////*/
    ul.menu {
      height: 0;
      left: 0;
      margin: 0;
      position: absolute;
      width: 100%;

      li {
        height: 0;
        transition: height 400ms cubic-bezier(0.23, 1, 0.32, 1);
        overflow: hidden;

        a {
          color: hsl(var(--light));
        }
      }
    }

    #menu-toggle:checked ~ .menu {
      align-items: flex-end;
      display: flex;
      flex-direction: column;
      justify-content: flex-end;
      background: hsl(var(--dark));
      min-height: 100vh;
      padding-inline-start: 0px;
      position: fixed;
      z-index: 1100;
    }

    #menu-toggle:checked ~ .menu li {
      display: flex;
      justify-content: center;
      align-items: center;
      height: 2.5em;
      padding: var(--padd-xs);
      transition: height 400ms cubic-bezier(0.23, 1, 0.32, 1);
      width: 100%;

      &:not(:last-child) {
        border-bottom: 1px solid hsl(var(--light) / 0.4);
      }

      a {
        display: inline-block;
        text-align: center;
        width: 100%;
      }
    }

    /* ! contactbox.scss */
  }
}

@media (min-width: 768px) {
  header {
    background: hsl(var(--light));
    //height: auto;
    position: fixed;
    width: 100%;
    z-index: 1000;

    nav {
      display: grid;
      grid-template-columns: 2fr 4fr 1.5fr;
      justify-items: stretch;
      //color: #fff;
      height: auto;
      padding: 0 0 0 0;
      width: 100%;

      /* Logo /////////////////////////////////////*/
      #logo {
        //background: hsl(var(--light));
        //display: block;
        align-self: center;
        place-self: center;

        /*svg {
          display: block;
          margin-right: var(--padd-md);
        }*/
      }

      /* Switch ////////////////////////////////*/
      input#menu-toggle {
        display: none;
      }

      label.menu-button-container {
        display: none;

        div.menu-button {
          display: none !important;
        }
      }

      /* Navigation //////////////////////////////*/
      ul.menu {
        display: grid;
        grid-template-columns: 1fr 1fr 1fr 1fr;
        height: auto;
        list-style-type: none;
        margin: 0;
        padding: 0;
        position: relative;
        width: auto;

        li {
          height: auto;
          margin: 0 0;
          overflow: hidden;
          transition: none;
          width: auto;

          a {
            border-left: 1px solid hsl(var(--dark));
