sources.partials/team-teamlist.scss:
.team {
  padding-bottom: var(--padd-lg);

  .team-list {
    display: grid;
    grid-template-columns: 1fr;
    grid-template-rows: auto;
    gap: var(--padd-lg) 0px;
    margin-top: var(--padd-lg);

    .card:nth-child(2n) {
      background: hsl(var(--light));
    }

    .card {
      background: hsl(var(--light) / 1);
      border: 2px solid hsl(var(--white) / 0.5);
      border-radius: var(--rad-lg);
      box-shadow: (var(--shad-md));
      display: grid;
      grid-template-columns: 1fr;
      grid-template-rows: auto;
      gap: var(--padd-md);
      overflow: hidden;
      padding: var(--padd-md);
      width: 100%;

      h3,
      h4,
      p {
        margin-top: 0;
      }

      a {
        color: var(--body-color);

        &:hover {
          color: var(--primary);
        }
      }

      .desc {
        padding-left: var(--padd-xs);
      }

      .phone,
      .email,
      .availability,
      .booking {
        background: hsl(var(--dark) / 0.1);
        border-radius: var(--rad-lg);
        align-self: start;
        font-size: calc(var(--scale) / 1.6 * 1rem);
        padding: var(--padd-md);
        transition: 3s;

        a {
          display: block;
          width: 100%;

          svg {
            display: inline-block;
            float: left;
            height: 20px;
            margin-right: var(--padd-md);
            position: relative;
            top: 1px;
            width: 20px;
          }
        }
      }

      .phone,
      .email,
      .availability,
      .booking {
        &:hover {
          background: radial-gradient(
            hsl(var(--prim) / 1) 0%,
            hsl(var(--prim) / 0.6) 100%
          );

          a,
          .fa-envelope,
          .fa-phone-alt,
          .fa-calendar-check {
            color: hsl(var(--white) / 1);
          }
        }
      }

      .portrait {
        img {
          border-radius: var(--rad-lg);
          height: auto;
          width: 100%;
        }
      }
    }
  }
}

@media only screen and (min-width: 567px) {
  .team .team-list .card {
    grid-template-columns: 1fr 1fr;

    .name {
      grid-column: span 2;
    }
  }
}

@media only screen and (min-width: 768px) {
  .team .team-list .card {
    grid-template-columns: 1fr 1fr 1fr 1fr;

    .name {
      grid-column: span 4;
    }

    .desc {
      grid-column: span 3;
    }
    .email,
    .phone,
    .availability,
    .booking {
      grid-column: span 2;
    }
  }
}

@media only screen and (min-width: 1024px) {
  .team .team-list .card {
    .email,
    .phone,
    .availability,
    .booking {
      grid-column: span 1;
    }
  }
}

sources.partials/tooltips.scss:
.tooltips {
  position: relative;
}

.tooltips::before {
  background: var(--black);
  border-radius: 5px;
  color: var(--white);
  content: attr(data);
  display: inline-block;
  position: absolute;
    bottom: 50%;
    left: -50%;
  opacity:0;
  overflow:hidden;
  padding: 1rem;
  pointer-events: none; /* prevents tooltip from firing on pseudo hover */
  text-align: left;
  transition:0.3s;
}

.tooltips:hover::before {
  bottom: 100%;
  opacity:1;
}


#contactbox .tooltips::before {
  left: -100px;
}

#map-snippet .tooltips::before {
  left: -100px;
}

#contactsection .tooltips::before {
  left: -100px;
}

